import React from "react";
import { StyleSheet, css } from "aphrodite/no-important";
import { Link } from "react-router-dom";


const Menu = () => {
	return (
		<div>
			<ul>
				<Link to="/login" >
					Login
				</Link>
			</ul>
			<ul>
				<Link to="/dashboard" >
					Dashboard
				</Link>
			</ul>
		</div>
	);
};

export default Menu;
